PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE admin (
	id INTEGER NOT NULL, 
	email VARCHAR(100) NOT NULL, 
	password_hash VARCHAR(255) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (email)
);
CREATE TABLE setting (
	id INTEGER NOT NULL, 
	"key" VARCHAR(100) NOT NULL, 
	value TEXT, 
	PRIMARY KEY (id), 
	UNIQUE ("key")
);
CREATE TABLE pass (
	id INTEGER NOT NULL, 
	pass_code VARCHAR(16) NOT NULL, 
	user_name VARCHAR(100) NOT NULL, 
	user_email VARCHAR(100) NOT NULL, 
	sold_amt FLOAT, 
	games_remaining INTEGER, 
	phone_number VARCHAR(20), 
	created_by INTEGER, 
	pass_created_dt DATETIME, 
	paid_ind BOOLEAN, paid_date DATETIME, activity VARCHAR(100), notes TEXT, marked_paid_by VARCHAR(120), 
	PRIMARY KEY (id), 
	FOREIGN KEY(created_by) REFERENCES admin (id), 
	UNIQUE (pass_code)
);
CREATE TABLE redemption (
	id INTEGER NOT NULL, 
	pass_id INTEGER NOT NULL, 
	date_used DATETIME, 
	redeemed_by VARCHAR(100), 
	PRIMARY KEY (id), 
	FOREIGN KEY(pass_id) REFERENCES pass (id)
);
CREATE TABLE ebank_payment (
	id INTEGER NOT NULL, 
	timestamp DATETIME, 
	subject TEXT, 
	bank_info_name VARCHAR(100), 
	bank_info_amt FLOAT, 
	matched_pass_id INTEGER, 
	matched_name VARCHAR(100), 
	matched_amt FLOAT, 
	result VARCHAR(50), 
	note TEXT, name_score INTEGER, from_email VARCHAR(150), mark_as_paid BOOLEAN, 
	PRIMARY KEY (id), 
	FOREIGN KEY(matched_pass_id) REFERENCES pass (id)
);
CREATE TABLE reminder_log (
	id INTEGER NOT NULL, 
	pass_id INTEGER NOT NULL, 
	reminder_sent_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(pass_id) REFERENCES pass (id)
);
CREATE TABLE email_log (
	id INTEGER NOT NULL, 
	timestamp DATETIME, 
	to_email VARCHAR(150) NOT NULL, 
	subject VARCHAR(255) NOT NULL, 
	pass_code VARCHAR(16), 
	template_name VARCHAR(100), 
	context_json TEXT, 
	result VARCHAR(50), 
	error_message TEXT, 
	PRIMARY KEY (id)
);
CREATE TABLE user (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	email VARCHAR(100), 
	phone_number VARCHAR(20), 
	PRIMARY KEY (id)
);
CREATE TABLE activity (
	id INTEGER NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	type VARCHAR(50), 
	description TEXT, 
	sessions_included INTEGER, 
	price_per_user FLOAT, 
	goal_users INTEGER, 
	goal_revenue FLOAT, 
	cost_to_run FLOAT, 
	created_by INTEGER, 
	created_dt DATETIME, 
	status VARCHAR(50), payment_instructions TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(created_by) REFERENCES admin (id)
);
CREATE TABLE passport (
	id INTEGER NOT NULL, 
	pass_code VARCHAR(16) NOT NULL, 
	user_id INTEGER NOT NULL, 
	activity_id INTEGER NOT NULL, 
	sold_amt FLOAT, 
	uses_remaining INTEGER, 
	created_by INTEGER, 
	created_dt DATETIME, 
	paid BOOLEAN, 
	paid_date DATETIME, 
	marked_paid_by VARCHAR(120), 
	notes TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(activity_id) REFERENCES activity (id), 
	FOREIGN KEY(created_by) REFERENCES admin (id), 
	FOREIGN KEY(user_id) REFERENCES user (id), 
	UNIQUE (pass_code)
);
CREATE TABLE signup (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	activity_id INTEGER NOT NULL, 
	subject VARCHAR(200), 
	description TEXT, 
	form_url VARCHAR(500), 
	form_data TEXT, 
	signed_up_at DATETIME, 
	paid BOOLEAN, 
	paid_at DATETIME, 
	passport_id INTEGER, status VARCHAR(50), 
	PRIMARY KEY (id), 
	FOREIGN KEY(activity_id) REFERENCES activity (id), 
	FOREIGN KEY(passport_id) REFERENCES passport (id), 
	FOREIGN KEY(user_id) REFERENCES user (id)
);
CREATE TABLE admin_action_log (
	id INTEGER NOT NULL, 
	timestamp DATETIME, 
	admin_email VARCHAR(150), 
	action TEXT, 
	PRIMARY KEY (id)
);
CREATE INDEX ix_signup_status ON signup (status);
COMMIT;
